import React, { Component } from 'react';
import Emocao from './Emocao';
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";


class App extends Component {
constructor(props) {
    super(props);
    this.state = {
      posts: []
    }
  }render() {
    return (
    <Router>
      <Routes>
        <Route path="/about" element={<Emocao />} />
      </Routes>
    </Router>
    );
  }
}
export default App;
